import { Payment } from "../../payment/payment";
export const Unitmanage=()=>
{
    return(
        <>
        <Navbar/>
        <div className="home">
            <div className="adpage">
                <Comp/>
                <section>
                    <div className="edit">
                            <Payment/>
                    </div>
                </section>
            </div>
        </div>
        <Footer/>
        </>
    )
}
